<body>
    <div id="root"></div>

    <script type="text/babel">
        function ValentineMessage() {
            const [hearts, setHearts] = React.useState(0);

            return (
                <div className="container">
                    <div className="heart" onClick={() => setHearts(hearts + 1)}> {hearts}</div>
                    <h1>Happy Valentine's Day, Aditi!</h1>
                    <p>Actually, you are not my sister, <strong>'you are the only sister that I have.'</strong></p>
                    <p>You are the only one with whom I can share my pain, emotions, happiness, and feelings .</p>
                    <p>How do people make it through life without a sister? I dont know.</p>
                    <p>But I am blessed that I have you.</p>
                    <p>Thank you for being my guide, my strength, and my biggest supporter.</p>
                    <p>Wishing you happiness, love, and success in everything you do. You deserve the best!</p>
                    <p>With love,</p>
                    <p>Your biggest well-wisher  </p>
                    <div className="footer">Designed with love, just for you!</div>
                </div>
            );
        }

        ReactDOM.render(<ValentineMessage />, document.getElementById('root'));
    </script>
